import './App.css';
import React from 'react';
import Register from './Register';
import Login from './Login';

function App() {
  const [formState,setFormState]=React.useState('login');

  const handleClick=()=>{
    if(formState === 'login') setFormState('register');
    else setFormState('login')
  }

  return (
    <div>
      <Login/>
      <Register/>
    </div>
  ); 
}

export default App;
